class Solution {
  int numberOfPowerfulInt(int start, int finish, int limit, String s) {
    int count = 0;
    int suffix = int.parse(s);
    if (suffix > finish) return 0;
    int sLen = s.length;
    int maxLen = ((finish.toString().length) - sLen).clamp(0, finish.toString().length);

    for (int i = 0; i <= maxLen; i++) {
      int minPossible = i == 0 ? suffix : int.parse('1' + '0' * i + s);
      int maxPossible = i == 0 ? suffix : int.parse(List.filled(i, limit.toString()).join('') + s);
      if (minPossible > finish || maxPossible < start) continue;

      for (int j = minPossible; j <= maxPossible && j <= finish; j++) {
        String numStr = j.toString();
        if (numStr.endsWith(s) && numStr.split('').every((d) => int.parse(d) <= limit)) {
          if (j >= start && j <= finish) count++;
        }
      }
    }
    return count;
  }
}
